import axios from 'axios';

const apiUrl = 'http://localhost:6999/users';

export const ADD_WINNERS_BY_WEEK = 'winners: addWinnersByWeekAction';

export const dispatchUsersAction = (users) => {
    console.log(users)
      return {
          type: ADD_WINNERS_BY_WEEK ,
          payload: {
              users: users
          }
      }
  }
